(4, 'support_policy_page', 'Shipping & Delivery', 'supportpolicy', '<p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\"><span style=\"mso-spacerun:yes\">&nbsp;</span></span><b><span style=\"font-size:14.0pt;mso-bidi-font-size:11.0pt;text-transform:\r\nuppercase\" lang=\"EN-US\">Shipping and delivery:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\">WELCOME TO OUR SHIPPING AND delivery POLICIES. WE ARE\r\nALWAYS GLAD TO SERVE YOU.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">Please note that all the products\r\nwill be shipped from varanasi, India.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\">q. 1. PRE-PAID OR CASH-ON-DELIVERY (c.o.d.) OR BOTH,\r\nWHICH TYPE OF ORDERS TAKE PLACE AT www.mangalutsav.com? </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal;tab-stops:175.5pt\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\">a. 1.</span></b><span style=\"mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;text-transform:uppercase\" lang=\"EN-US\"> WE ONLY\r\nPROCESS PREPAID ORDERS. CASH-ON-DELIVERY (C.O.D.)<b> </b>FACILITY<b> </b>IS\r\nCURRENTLY NOT AVAILABLE.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase;text-shadow:auto\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">q. 2. WHERE DO we use to DELIVER IN\r\nINDIA?<span style=\"mso-spacerun:yes\">&nbsp;&nbsp; </span>RURAL AREA OR URBAN AREA OR\r\nBOTH? is AREA PINCODE necessary OR WIHOUT AREA PINCODE will do?</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"text-transform:\r\nuppercase\" lang=\"EN-US\">a. 2. </span></b><span style=\"text-transform:uppercase;\r\nmso-bidi-font-weight:bold\" lang=\"EN-US\">We deliver to MOSTLY all urban areas in india</span><b style=\"mso-bidi-font-weight:normal\"><span style=\"text-transform:\r\nuppercase\" lang=\"EN-US\"> </span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\">(WHERE\r\nALL TOP NATIONAL COURIER COMPANIES USE TO DELIVER)</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">However, Courier companies do not\r\ndeliver to P.O. Box address, so we request you to provide full street addresses\r\nalong with YOUR CORRECT <b>area pin code</b> AND A REACHEABLE <b>CONTACT NUMBER</b>.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q. 3. WHICH national COURIER\r\nSERVICES DO WE USE to ship our products? </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A. 3.</span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\"> We ship OUR all orders USING RELIABLE NATIONAL\r\ncourier services like:</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntext-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;text-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">INDIA\r\nPOST (SPEED POST)</span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;text-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">DTDC\r\nCOURIER AND CARGO LIMITED</span></b><span style=\"text-transform:\r\nuppercase\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;text-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">TRACKON\r\nCOURIERS PRIVATE LIMITED</span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;text-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">ondot\r\ncouriers and cargo ltd.</span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;text-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">THE\r\nPROFESSIONAL COURIER NETWORK LIMITED</span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;text-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">SKYKING\r\nCOURIER (SHREE SHYAM AIR SERVICE)</span></b><span style=\"text-transform:\r\nuppercase\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;text-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">SHREE\r\nMARUTI COURIER SERVICE PVT. LTD. </span></b><span style=\"text-transform:\r\nuppercase\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntext-indent:-18.0pt;line-height:normal;mso-list:l0 level1 lfo2\"><span style=\"font-family:Symbol;mso-fareast-font-family:Symbol;mso-bidi-font-family:\r\nSymbol;text-transform:uppercase;mso-bidi-font-weight:bold\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">·<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">overnite\r\nexpress, etc.</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q. 4. HOW DO WE DECIDE SHIPPING\r\nCHARGES FOR ANY SHIPMENT?</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">a. 4. Please</span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\"> note that the <b>shipping rates\r\nare weight based</b>. The weight of any product can be found on its detail\r\npage. all weights will be rounded up to the next 500 grams To match the\r\npolicies of the shippinG COMPANIES.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:18.0pt;line-height:normal\"><span style=\"text-transform:\r\nuppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\">Q. 5. how many hours does it take to DiSPATCH any SHIPMENTS?\r\n</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\">A. 5. </span></b><span style=\"mso-bidi-font-family:\r\nCalibri;mso-bidi-theme-font:minor-latin;text-transform:uppercase\" lang=\"EN-US\">it generally\r\ntakes minimum 6 hours to maximum 48 hours from the order placing time to dispatch\r\nthe ordered product during normal working days.<b> </b>it also depends on the\r\norder queue and the availability of finished ordred products at that time.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\">by chance, if ordered product is not available at\r\nthat time then customer is informed and refund is initiated within 24-48 hours\r\nfrom order placing time during working days.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">q. 6. HOW MANY DAYS DOES IT TAKE TO\r\nDELIVER A SHIPMENT? </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">a. 6.</span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\"> OUR All shipments are DiSPATCHED THROUGH fast\r\nand reliable NATIONAL courier services and if everything goes fine then\r\nshipment IS delivered TO OUR CUSTOMERS within (approximately) 3-5 working days\r\nfrom the shipment dispatch date, or say, approximately within 5-10 days from\r\nthe order placing date. deliveries are generally made during normal working DAYS\r\n&amp; WORKING hours of our partner courier companies.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">actually, delivery time of a\r\nshipment also depends on certain factors like distance of delivery location,\r\ncurrent transit conditions, gazatted holidays, weekly holidays, etc.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q.7. What if two or more products\r\nare ordered at the same time for the same address?</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.7. </span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-spacerun:yes\">&nbsp;</span>if two\r\nor more products are ordered at the same time by the same customer for the same\r\ndelivery address, then, definitely we will try our best to despatch all the ordered\r\nproducts at once, together.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">if any number of products is not\r\navailable at that time, then we use to despatch all available products instantly\r\nwithout waiting for the unavailable product to become available. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">you may receive multiple products\r\nin multiple boxes on different days, because of item availability. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q. 8. some possible REASONS FOR\r\nDELAYS:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A. 8. </span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntext-indent:-18.0pt;line-height:normal;mso-list:l1 level1 lfo1\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">INCOMPLETE ADDRESS (WITHOUT house\r\nno., PINCODE &amp; mOBILE NUMBER)</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l1 level1 lfo1\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">NATURAL DISASTERS (FLOOD,\r\nHURRICANE, EARTHQUAKE, PANDEMICS, ETC.)</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l1 level1 lfo1\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">oTHER PROBLEMS (POLITICAL PROBLEMS:\r\nANY RALLYS-CLOSED MARKETS,ELECTIONS)</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l1 level1 lfo1\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">MANY GAZATTED HOLIDAYS PLUS\r\nWEEKENDS IN A SEQUENCE.</span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto;text-indent:-18.0pt;line-height:normal;mso-list:l1 level1 lfo1\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">WEATHER PROBLEMS: FOG, HEAVY RAIN,\r\nETC., </span></b></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntext-indent:-18.0pt;line-height:normal;mso-list:l1 level1 lfo1\"><b><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin;\r\ntext-transform:uppercase\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">6.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span></b><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">NOT REACHEABLE/CONTINUOSLY\r\nBUSY/SWITCHED OFF/WRONG CONTACT NUMBERS OF CUSTOMERS CAN STIMULATE DIFFICULTY\r\nOF COURIER BOY/GIRL.</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q.9. what are transit risks and how\r\ncustomer’s money is safe with us? </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.9. </span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\">we ship all parcels as fully insured at no\r\nextra cost of insurance to customers. If Courier Company does not deliver the\r\nproduct or product is partially or fully damaged while transit, you do not\r\nsuffer any loss. In-transit risk are all ours. But mangalutsav.com will not be responsible\r\nfor lost and stolen packages or any full or partial damages to the package\r\nafter being left at customer\'s address by postal / courier agency. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">after confirming shipment damage\r\nwhile transit, we will refund the amount/ replace the product once again\r\naccording to customer’s wish. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q.10. Shipment and tracking details?</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.10. </span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\">We will send you an email/SMS containing the despatch\r\ndetails of your ordered products, as soon as the items are handed over to our partner\r\nCourier. These alert emails/sms will contain the tracking number and courier companies\r\nwebsite details along with expected date of delivery. You may also check the\r\nsame on our order status page.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">Tracking numbers for orders shipped\r\nmight take 24 business hours to become active on the courier company’s websites.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q.11. Address change requests?</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.11. </span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Once an order is registered, you cannot make\r\nany alterations. However, address alteration requests may be accommodated\r\nwithin 6 hours of placing the order. You may send your alteration request to <b><a href=\"mailto:INFO@mangalutsav.com\">INFO@mangalutsav.com</a> or whatsapp us\r\n08765504000</b> and the needfull will be done.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q.12.Multiple address order?</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.12. </span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Currently this option is not available.\r\nHowever, if you want to send the product to different addresses, you can place separate\r\nOrders.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.13. Incorrect or incomplete\r\naddress</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.13. </span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Please note: some courier companies charge a\r\npenalty for incorrect shipping addresses, wherein the address and zip code do\r\nnot match. The customer will, without exception, bear the cost of any such\r\npenalties and/or fees &amp; not mangalutsav.com (M/s shubhkamna fabrics).\r\nPlease make sure your shipping address is correct.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">In the event of a re-shipment of\r\nthe same order, customers will be responsible to pay re-shipping charges for\r\nthe re-shipment.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q.14.Packing Method</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.14.</span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\">All products are first polythene packed &amp;\r\nthen put in corrugated box as per need in accordance with product type. we\r\ncarefuly pack the products to avoid any mishappening.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q.15.What if any Delays?</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.15. </span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Time to ship mentioned on our website against\r\neach items are indicative and approximate values only and sometimes due to\r\nsituations beyond our control, delays may occur. No refund, returns,\r\nreplacement &amp; exchange will be entertained for this reason.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">However, any dates for delivery are\r\napproximate only and we are not liable for any delay in delivering your order\r\nor any part of it. We may choose to deliver your order in separate parts. In\r\nsome cases, we may offer to refund you for unfulfilled part of the order.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Q.16. what is Billing Address and\r\nShipping Address?</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b><span style=\"text-transform:uppercase\" lang=\"EN-US\">A.16. </span></b><span style=\"text-transform:uppercase\" lang=\"EN-US\">Billing Address is the address where a\r\ncustomer gets his bills from the credit card company. Shipping address is the\r\naddress where the customer wants to receive their shipmentS.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">If you have any question about your\r\norder/shipment/delivery,<b> you can contact us using:</b> <b>whatsapp(at+91-8765504000)\r\n10:00am to 06:00pm during</b> (Monday to Saturday) or email us on <b>INFO@mangalutsav.com</b>\r\nor also you can login and check your Order Status on <b>www. mangalutsav.com</b>\r\n</span><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif\" lang=\"EN-US\">.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-left:18.0pt;text-align:justify\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"text-transform:uppercase\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:RelyOnVML/>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:Ignore