(7, 'custom_page', 'About Us', 'about-us', '<h6 align=\"left\">\r\n\r\n</h6><h6 class=\"MsoNormal\" style=\"line-height:normal\" align=\"left\"><span style=\"background-color: rgb(231, 214, 222);\"><font color=\"#4A1031\"><b><span style=\"font-size:12.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\">‘KAASHI’ </span></b><span style=\"font-size:12.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\">OR ‘<b>BANARAS’, </b><b style=\"mso-bidi-font-weight:\r\nnormal\">CITY &amp; CULTURE, WE REPRESENT:</b></span></font></span></h6><h6><font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\">\r\n\r\n</span></font></h6><h6 class=\"MsoNormal\" style=\"line-height: normal;\" align=\"left\"><font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-size:12.0pt;font-family:\" book=\"\" antiqua\",serif;=\"\" mso-fareast-font-family:calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\">Varanasi is one\r\nof the most ancient and religious cities in the world, situated at the bank of\r\nthe holy river Ganges, has been famous for its spiritual wisdom, Indian\r\nclassical music, poetry, literature, art, education, yoga, ancient temples,\r\nriver ganga ghaats, banarasi paan, delicious chaat, cultural richness, unity in\r\ndiversity, vivacity along with <span style=\"mso-spacerun:yes\">&nbsp;</span>traditional <b>Ethnic Fabric, Sarees</b> and <b>Handicrafts</b>, since ages.</span></span></font></h6><h6><font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\">\r\n\r\n</span></font></h6><h6 class=\"MsoNormal\" style=\"line-height: normal;\" align=\"left\"><font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-size:12.0pt;font-family:\" book=\"\" antiqua\",serif;=\"\" mso-fareast-font-family:calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\">Certainly, roots\r\nof our auspicious traditions and culture are being kept intact and enlivened at\r\n<b><a href=\"www.mangalutsav.com\" target=\"_blank\">www.mangalutsav.com</a></b> (M/s <b>Shubhkamna Fabrics, Registered Trademark: “mangal\r\nutsav: celebration of auspicious traditions”</b>).</span></span></font></h6><h6><font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\">\r\n\r\n</span></font></h6><h6 class=\"MsoNormal\" style=\"line-height: normal;\" align=\"left\"><span style=\"background-color: rgb(231, 214, 222);\"><font color=\"#4A1031\"><b><span style=\"font-size:12.0pt;font-family:\r\n\" book=\"\" antiqua\",serif;mso-fareast-font-family:calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\">ABOUT\r\nUS: </span></b></font></span></h6><h6><font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\">\r\n\r\n</span></font></h6><h6 class=\"MsoNormal\" style=\"line-height: normal;\" align=\"left\">\r\n \r\n \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n  \r\n \r\n \r\n \r\n\r\n \r\n \r\n<font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"font-size:12.0pt;font-family:\" book=\"\" antiqua\",serif;=\"\" mso-fareast-font-family:calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\">We at <b><a href=\"mangalutsav.com\" target=\"_blank\">mangalutsav.com</a></b>\r\n(M/s <b>Shubhkamna Fabrics, Registered Trademark: “mangal utsav: celebration of\r\nauspicious traditions”</b>) are <b>manufacturing &amp; trading</b><span style=\"mso-bidi-font-weight:bold\"> i</span>n <span style=\"mso-bidi-font-weight:\r\nbold\">all types of banarasi dress materials, made-ups, handmade ethnic products\r\nfor more than three decades. </span>We only sell best quality genuine indian\r\nethnic products<b>.</b></span></span></font></h6><h6 class=\"MsoNormal\" style=\"line-height: normal;\" align=\"left\"><font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\"><span style=\"mso-bidi-font-size:11.0pt;\r\nfont-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:calibri;mso-bidi-font-family:=\"\" calibri\"=\"\" lang=\"EN-US\"><b><img src=\"data:image/jpeg;base64,\" alt=\"\"></b><span style=\"background-color: rgb(231, 214, 222);\">We<b> </b>are authorized user of <span style=\"background-color: rgb(255, 231, 206);\"><b>“</b></span></span></span><span style=\"background-color: rgb(231, 214, 222);\"><span style=\"background-color: rgb(255, 231, 206);\"><b><span style=\"font-size:10.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\">SILK MARK</span></b></span><b><span style=\"mso-bidi-font-size:11.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\"><span style=\"background-color: rgb(255, 231, 206);\">”</span> </span></b></span><span style=\"mso-bidi-font-size:11.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\"><span style=\"background-color: rgb(231, 214, 222);\">issued by</span> <span style=\"background-color: rgb(255, 239, 198);\">“</span></span><b><span style=\"font-size:10.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\"><span style=\"background-color: rgb(255, 239, 198);\">SILK MARK ORGANIZATION OF INDIA” (S.M.O.I.),\r\n“MINISTRY OF TEXTILES”, GOVT. OF INDIA.</span> </span></b></span></font></h6><h6><font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\">\r\n\r\n</span></font></h6><h6 class=\"MsoNormal\" style=\"line-height: normal;\" align=\"left\">\r\n \r\n \r\n<font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\"><b><span style=\"mso-bidi-font-size:11.0pt;font-family:\r\n\" book=\"\" antiqua\",serif;mso-fareast-font-family:calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\"></span></b></span></font></h6><h6><font color=\"#4A1031\"><span style=\"background-color: rgb(255, 255, 255);\">\r\n\r\n</span></font></h6><h6 class=\"MsoNormal\" style=\"line-height: normal;\" align=\"left\"><font color=\"#4A1031\"><span style=\"background-color: rgb(231, 214, 222);\"><b><span style=\"font-size:10.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\"><span style=\"background-color: rgb(255, 239, 198);\"></span></span></b><span style=\"font-size:10.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\"><b><span style=\"background-color: rgb(255, 231, 156);\"><span style=\"background-color: rgb(255, 239, 198);\"></span></span></b></span><b><span style=\"font-size:12.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\"><img src=\"data:image/jpeg;base64,\" alt=\"\" style=\"\"></span></b><span style=\"mso-bidi-font-size:11.0pt;\r\nfont-family:\" lang=\"EN-US\">We<b> </b>are authorized user of<b> </b></span><b><span style=\"font-size:10.0pt;font-family:\" lang=\"EN-US\"><span style=\"background-color: rgb(255, 239, 198);\">“HANDLOOM MARK”</span></span> </b><span style=\"font-size:10.0pt;font-family:\" book=\"\" antiqua\",serif;mso-fareast-font-family:=\"\" calibri;mso-bidi-font-family:calibri\"=\"\" lang=\"EN-US\">issued by<b><span style=\"background-color: rgb(255, 231, 156);\"> <span style=\"background-color: rgb(255, 239, 198);\">“MINISTRY OF TEXTILES”,\r\nGOVT. OF INDIA.</span></span></b></span></span></font></h6><h6 class=\"MsoNormal\" style=\"line-height: normal;\" align=\"left\">\r\n\r\n</h6><h6 class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\nline-height:normal\"><span style=\"background-color: rgb(231, 214, 222);\"><font color=\"#4A1031\"><b><span style=\"font-size:12.0pt;font-family:\r\n&quot;Book Antiqua&quot;,serif;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri\" lang=\"EN-US\">OUR AIM:</span></b></font></span></h6><h6><font color=\"#4A1031\">\r\n\r\n</font></h6><h6 class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\nline-height:normal\"><font color=\"#4A1031\"><span style=\"font-size:12.0pt;font-family:&quot;Book Antiqua&quot;,serif;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri;mso-bidi-font-weight:\r\nbold\" lang=\"EN-US\">Our aim is to </span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Book Antiqua&quot;,serif;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri\" lang=\"EN-US\">offer\r\n<b style=\"mso-bidi-font-weight:normal\">best quality and genuine </b>ethnic\r\nproducts at a very <b>competitive &amp;</b> <b style=\"mso-bidi-font-weight:\r\nnormal\">reasonable price </b><span style=\"mso-bidi-font-weight:bold\">at one\r\nplace</span><b style=\"mso-bidi-font-weight:normal\">.</b></span></font></h6><h6><font color=\"#4A1031\">\r\n\r\n</font></h6><h6 class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\nline-height:normal\"><span style=\"background-color: rgb(231, 214, 222);\"><font color=\"#4A1031\"><b><span style=\"font-size:12.0pt;font-family:\r\n&quot;Book Antiqua&quot;,serif;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri\" lang=\"EN-US\">OUR\r\nVISION: <br></span></b></font></span></h6><h6><font color=\"#4A1031\">\r\n\r\n</font></h6><h6 class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\nline-height:normal\"><font color=\"#4A1031\"><span style=\"font-size:12.0pt;font-family:&quot;Book Antiqua&quot;,serif;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri\" lang=\"EN-US\">Every indian soul\r\nis woven with the threads of our auspicious indian culture and traditions by\r\ntheir birth. And being culture driven, we also want to play a small part by providing\r\nan opportunity to our Indian customers to overwhelm themselves by using our native\r\nproducts.</span></font></h6><h6><font color=\"#4A1031\">\r\n\r\n</font></h6><h6 class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\nline-height:normal\"><font color=\"#4A1031\"><span style=\"font-size:12.0pt;font-family:&quot;Book Antiqua&quot;,serif;\r\nmso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri\" lang=\"EN-US\">And, therefore,\r\nwe will try our best to make our products available to every indian soul living\r\nin any part of the entire globe. <span style=\"background-color: rgb(231, 214, 222);\">THANK YOU FOR READING ABOUT US</span>.<br></span></font></h6><h6><font color=\"#4A1031\">\r\n\r\n</font></h6><h6 class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph;\r\nline-height:normal\"><font color=\"#4A1031\"><b><span style=\"font-size:10.0pt;font-family:\r\n&quot;Book Antiqua&quot;,serif;mso-fareast-font-family:Calibri;mso-bidi-font-family:Calibri\" lang=\"EN-US\"><span style=\"background-color: rgb(255, 156, 0);\">VANDE </span><span style=\"background-color: rgb(255, 255, 255);\">MATARAM </span><span style=\"background-color: rgb(0, 255, 0);\">JAI HIND</span><br></span></b></font></h6>\r\n\r\n<h6 class=\"MsoNormal\" style=\"line-height: normal;\" align=\"left\"><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:RelyOnVML/>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN