INSERT INTO `pages` (`id`, `type`, `title`, `slug`, `content`, `meta_title`, `meta_description`, `keywords`, `meta_image`, `created_at`, `updated_at`) VALUES
(9, 'custom_page', 'Product Care', 'productcare', '<p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-4.5pt;line-height:normal\"><b><span style=\"font-size:\r\n12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">Ethnic Fabrics/Made-ups Care\r\nSuggestions:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">Dress Materials/ Garments should only be\r\ndry-cleaned once a season.</span><b><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\"> </span></b><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">Washing dress\r\nmaterials</span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">/made-ups\r\n</span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">at&nbsp;home\r\nmay result in shrinkage, limpness, and considerable&nbsp;fading and other\r\nsevere problems</span><span style=\"font-size:12.0pt;font-family:\r\n&quot;Cambria&quot;,serif\" lang=\"EN-US\">. We also found that</span><span style=\"font-size:\r\n12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\"> vibrant colors fade in washing,\r\nor&nbsp;multi-colored dyes will run into one another. We see it always when\r\nlight and darker dyed </span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">fabrics/made-ups</span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\"> are combined. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">Excessive cleaning of fabrics/made-ups ruins them\r\nsooner.&nbsp;Some luxurious made-ups such as: Sherwanis, Indo-Westerns and\r\nJackets can be worn more than once before washing or cleaning if you give them\r\njust a little care when you remove them.&nbsp; Always check them for spots,\r\ntears, lint, or anything else that would let them ruin.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">When you iron or press fabrics/made-ups, use the\r\nproper heat setting for the type of fabric, excess hot will definitely ruin the\r\nfabrics/made-ups in an instant. Pressing very delicate fabrics/made-ups should\r\nbe done with immense care, using a press cloth may be a good aid for their protection.&nbsp;</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">Don’t press stained or soiled fabrics/made-ups.\r\nHeat is another factor&nbsp;that makes stains more difficult to remove.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">Always let lotions, antiperspirants, perfume, </span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">hair spray </span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">and other\r\ntoiletries to dry before you get dressed. Try to avoid these products because these\r\ncan contain ingredients that cause color fade or color changes (i.e. </span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">staining)</span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\"> and also\r\nweakens the fabrics/made-ups.</span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\"> </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">6.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">Water and Perspiration both can cause dyes in multicolor\r\nfabrics/made-ups to change color so, if&nbsp;possible, protect your\r\nfabrics/made-ups from contact with perspiration or water.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">7.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">Check the fabrics/made-ups when you take it\r\noff.<span style=\"mso-spacerun:yes\">&nbsp; </span>Before putting clothes away for\r\nstorage, have them cleaned&nbsp;to remove stains first. This can prevent\r\ninsects from causing holes&nbsp;in the fabrics/made-ups, and stains from ageing\r\nand discoloring. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">8.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">Store </span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">fabrics/made-ups</span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\"> in a dark area. Long\r\nexposure to sunlight or&nbsp;even strong lights can cause streaks and fading. </span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">9.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">Always change your good made-ups before attempting\r\nthe dirty tasks, it will save the ethnic made-ups from potential damages.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">10.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">Areas that are\r\nrepeatedly rubbed during wear may lose&nbsp;finish, creating lighter areas or a\r\nshaded appearance.&nbsp;We typically see this occurrence in the seat, waist,\r\ninner&nbsp;thigh, elbows, or other areas of wear. The edges or folds&nbsp;at\r\nthe lapels, hems, collar, and cuff may show loss of the finish as well.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">11.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">Silk, satin and other\r\nfragile or loosely woven fabrics are especially vulnerable to snags and\r\nabrasion. Silk will&nbsp;chafe easily or develop light&nbsp;areas if rubbed\r\nwhile wet.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">12.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">Minimize the use of\r\nornamented handbags, jewelry and shoulder straps with these fine fabrics.&nbsp;\r\nIt can result in irreparable </span><span style=\"font-size:12.0pt;\r\nfont-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\">fabrics/made-ups</span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\"> damage and abrasion.</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">13.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">Never use chlorine\r\nbleach or products containing chlorine on&nbsp;silk</span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif\" lang=\"EN-US\"> fabrics/made-ups</span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">. It will permanently\r\nchange the color. </span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\nmargin-bottom:0cm;margin-left:18.0pt;mso-add-space:auto;text-indent:-22.5pt;\r\nline-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\nCambria;mso-bidi-font-family:Cambria\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">14.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">Contact with any of\r\nthe following can cause discoloration:</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-indent:14.2pt;line-height:\r\nnormal;tab-stops:18.0pt\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Cambria&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;\" lang=\"EN-US\">• Hand Sanitizers, Water</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-indent:14.2pt;line-height:\r\nnormal;tab-stops:18.0pt\"><span style=\"font-size:12.0pt;font-family:\r\n&quot;Cambria&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-bidi-font-family:\r\n&quot;Times New Roman&quot;\" lang=\"EN-US\">• Body Sprays</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:21.3pt;text-indent:-7.1pt;line-height:normal;tab-stops:18.0pt\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">• Deodorants and\r\nother&nbsp;consumer and household&nbsp;products</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:35.45pt;text-indent:-21.25pt;line-height:normal;tab-stops:18.0pt\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">• Moisturizers and\r\nother skin&nbsp;care products</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:35.45pt;text-indent:-21.25pt;line-height:normal;tab-stops:18.0pt\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">• Alcohol</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:35.45pt;text-indent:-21.25pt;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">• Perfume or cologne</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:35.45pt;text-indent:-21.25pt;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">• Hair spray</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:35.45pt;text-indent:-21.25pt;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">• Shampoo</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:35.45pt;text-indent:-21.25pt;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">• Home detergents\r\nand&nbsp;dish liquids</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:35.45pt;text-indent:-21.25pt;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Cambria&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-bidi-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">• Toothpaste</span></p>