INSERT INTO `page_translations` (`id`, `page_id`, `title`, `content`, `lang`, `created_at`, `updated_at`) VALUES
(3, 8, 'Payment Terms', '<p>\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">Payment Options</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">A. Online Payment Mode</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">A.1 Credit Cards</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">Please note that we accept only\r\nDomestic Cards. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">•American Express</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">•Visa</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">•MasterCard</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">To pay using your credit card at\r\ncheckout, you will need your card number, expiry date, three-digit CVV number\r\n(found on the backside of your card). After entering these details, you will be\r\nredirected to the bank\'s page for entering the online 3D Secure password</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">A.2 Debit Cards</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">Please note that we accept only\r\nDomestic Cards. </p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">•Visa</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">•MasterCard</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">•Maestro</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">To pay using your debit card at\r\ncheckout, you will need your card number, expiry date (optional for Maestro\r\ncards), three-digit CVV number (optional for Maestro cards). You will then be\r\nredirected to your bank\'s secure page for entering your online password (issued\r\nby your bank) to complete the payment.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">Safety measueres-</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">Your online transaction on Ethnic\r\nfabric is secure with the highest levels of transaction security currently\r\navailable on the Internet. Ethnic fabric uses 256-bit encryption technology\r\nsupported by CCAVENUE- MOST Trusted INDIAN payment gateway to protect your card\r\ninformation while securely transmitting it to the respective banks for payment\r\nprocessing.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">All credit card and debit card payments\r\non ethnic Fabrics are processed through secure and trusted payment gateways\r\nmanaged by leading banks. Banks now use the 3D Secure password service for\r\nonline transactions, providing an additional layer of security through identity\r\nverification.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">Prevention of fraud-</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">Ethnic fabric realizes the importance\r\nof a strong fraud detection and resolution capability. We and our online\r\npayments partners monitor transactions continuously for suspicious activity and\r\nflag potentially fraudulent transactions for manual verification by our team.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">In the rarest of rare cases, when our\r\nteam is unable to rule out the possibility of fraud categorically, the\r\ntransaction is kept on hold, and the customer is requested to provide identity\r\ndocuments. The ID documents help us ensure that the purchases were indeed made\r\nby a genuine card holder. We apologise for any inconvenience that may be caused\r\nto customers and request them to bear with us in the larger interest of\r\nensuring a safe and secure environment for online transactions.</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">B. Offline payment options</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">&nbsp;</p><br><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">Cash on Delivery (India Only) Only on\r\nrequest</p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:-2.85pt;line-height:normal\">We allow you to purchase with Cash On\r\nDelivery for deliveries to select destinations within India.</p>\r\n\r\n<p><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG/>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF/>\r\n  <w:LidThemeOther>EN-IN</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>HI</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables/>\r\n   <w:SnapToGridInCell/>\r\n   <w:WrapTextWithPunct/>\r\n   <w:UseAsianBreakRules/>\r\n   <w:DontGrowAutofit/>\r\n   <w:SplitPgBreakAndParaMark/>\r\n   <w:EnableOpenTypeKerning/>\r\n   <w:DontFlipMirrorIndents/>\r\n   <w:OverrideTableStyleHps/>\r\n  </w:Compatibility>\r\n  <m:mathPr>\r\n   <m:mathFont m:val=\"Cambria Math\"/>\r\n   <m:brkBin m:val=\"before\"/>\r\n   <m:brkBinSub m:val=\"&#45;-\"/>\r\n   <m:smallFrac m:val=\"off\"/>\r\n   <m:dispDef/>\r\n   <m:lMargin m:val=\"0\"/>\r\n   <m:rMargin m:val=\"0\"/>\r\n   <m:defJc m:val=\"cent