(6, 6, 'Privacy Policy Page', '<p>\r\n\r\n</p><p class=\"MsoSubtitle\"><b><span style=\"font-size:14.0pt;line-height:107%\">MANGALUTSAV.COM\r\n(M/s Shubhkamna Fabrics) - Privacy Policy</span></b></p>\r\n\r\n<p class=\"MsoSubtitle\">Your (“you” or “End User” or “Buyer” or “Customer”)\r\nprivacy is very important to us (“mangalutsav.com”, “M/s Shubhkamna Fabrics”,”we”,\r\n“our”, “site”). We strive to maintain the highest standards of integrity in our\r\nall operations. Similarly, we are dedicated to protect the privacy of our\r\ncustomers, consumers and online visitors and hence our Data handling practices\r\nare continually reviewed to ensure the compliance with European Union General\r\nData Protection Regulation (GDPR) 2018.<span style=\"mso-spacerun:yes\"> </span></p><p class=\"MsoSubtitle\"><span style=\"mso-spacerun:yes\"><br></span><span style=\"mso-spacerun:yes\"></span><span style=\"mso-spacerun:yes\"></span><span style=\"mso-spacerun:yes\"></span>The practices of this policy is also applicable to the\r\nservices available under the domain and sub domains of this Site. \r\n\r\n</p><p class=\"MsoSubtitle\">By using or accessing or visiting our site or also by entering\r\nyour personal details, you, hereby, acknowledge that you have read, understood\r\nand agreed to be bound by all the terms and conditions of this privacy policy\r\nand website’s terms and conditions. This privacy policy is applicable on every\r\nuser/visitor/buyer of the mangalutsav.com website. By accepting the Privacy\r\nPolicy and the User Agreement in registration and/or the use of the Site in\r\ngeneral, you expressly consent to our use and disclosure of your personal\r\ninformation in accordance with this Privacy Policy. This Privacy Policy is\r\nincorporated into and subject to the terms of the User Agreement.</p>\r\n\r\n<p class=\"MsoSubtitle\">This Privacy Policy does not apply to sites maintained by\r\nother third-party organizations which are linked to our website and we are not\r\nresponsible for any personal information you submit to third parties via our\r\nwebsite. Please ensure that you have already read the privacy policy of such\r\nother third-party firms/companies before submitting your personal details.</p>\r\n\r\n<p class=\"MsoSubtitle\">If you do not agree to these terms of privacy policy or\r\nwebsite’s terms and conditions, please exit the website and don’t access/use\r\nthe website.</p>\r\n\r\n<p class=\"MsoSubtitle\" style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:\r\nl0 level1 lfo1\"><b><span style=\"font-size:14.0pt;\r\nline-height:107%;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;\r\n</span></span></span></b><b><span style=\"font-size:12.0pt;line-height:\r\n107%\">USE OF COLLECTED PERSONAL INFORMATION</span></b></p>\r\n\r\n<p class=\"MsoSubtitle\"><span class=\"SubtitleChar\"><span style=\"font-family:\" calibri\",sans-serif;=\"\" mso-ascii-theme-font:minor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:=\"\" mangal;mso-bidi-theme-font:minor-bidi\"=\"\">We agree that we will not sell or rent\r\nyour personal information to third parties for their marketing purposes without\r\nyour explicit consent</span></span>.</p>\r\n\r\n<p class=\"MsoSubtitle\">MANGALUTSAV.COM collects personally identifiable information\r\nfrom the visitors to our website only on a voluntary basis. Personal\r\ninformation collected on a voluntary basis may include name, email address,\r\npostal address, date of birth and mobile number which may require at the time\r\nof registration &amp; payment for product you buy. This information is\r\ncollected if you request information from us, participate in a contest or\r\nsweepstakes, and sign up to join our email list or request some other service\r\nor information from us.</p>\r\n\r\n<p class=\"MsoSubtitle\">We require these details only to provide you the services\r\nwe offer. We use your address to deliver the order. We may use your phone\r\nnumber to help you resolve your queries while shopping. We notify you about our\r\nupdates and promotional schemes through SMS or email on your mobile number/ email\r\nID provided to us during the time of registration. You can inform us if you\r\nwish to stop receiving these mailers. We share your personal information with\r\nspecific employees who are involved in the execution of your transaction and\r\nany employee who violates our privacy and/or security policies is subject to\r\ndisciplinary action.</p>\r\n\r\n<p class=\"MsoSubtitle\">Such information will not be considered as sensitive if it\r\nis freely available and accessible in the public domain or is furnished under\r\nthe Right to Information Act, 2005 or any other law for the time being in\r\nforce.</p>\r\n\r\n<p class=\"MsoSubtitle\">You have the right to access and correct, or delete your\r\nPersonal Information and privacy preferences at any time. This may be\r\naccomplished by clicking on the link, \"My Profile\", where you can\r\nview and make changes to most of your Personal Information immediately. For\r\nsecurity purposes, certain Personal Information can only be changed by\r\ncontacting support. We will respond to your request promptly within a\r\nreasonable time.</p>\r\n\r\n<p class=\"MsoSubtitle\" style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:\r\nl0 level1 lfo1\"><b><span style=\"font-size:14.0pt;\r\nline-height:107%;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;\r\n</span></span></span></b><b><span style=\"font-size:14.0pt;line-height:\r\n107%\"><span style=\"mso-spacerun:yes\">&nbsp;</span>SHARE OF PERSONAL INFORMATION</span></b></p>\r\n\r\n<p class=\"MsoSubtitle\">We may share personal information with our other corporate\r\nentities and affiliates to help detect and prevent identity theft, fraud and\r\nother potentially illegal acts; correlate related or multiple accounts to\r\nprevent abuse of our services.</p>\r\n\r\n<p class=\"MsoSubtitle\">We may share information When it is requested or required\r\nby law or by any court or governmental agency or authority to disclose, for the\r\npurpose of verification of identity, or for the prevention, detection,\r\ninvestigation including cyber incidents, or for prosecution and punishment of\r\noffences. These disclosures are made in good faith and belief that such\r\ndisclosure is reasonably necessary for enforcing these Terms; for complying\r\nwith the applicable laws and regulations. We may disclose personal information\r\nto law enforcement offices or others in the good faith belief that such\r\ndisclosure is reasonably necessary to enforce our Terms or Privacy Policy.</p>\r\n\r\n<p class=\"MsoSubtitle\" style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:\r\nl0 level1 lfo1\"><b><span style=\"font-size:14.0pt;\r\nline-height:107%;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\"><span style=\"mso-list:Ignore\">3.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;\r\n</span></span></span></b><b><span style=\"font-size:14.0pt;line-height:\r\n107%\">NON-PERSONAL INFORMATION</span></b></p>\r\n\r\n<p class=\"MsoSubtitle\">In some cases, we may collect information about you that\r\nis not personally identifiable. We use this information-which does not identify\r\nindividual users, including your IP address, when you visit our site, it is\r\nsolely used to analysis trends and administer the site, to track users\'\r\nmovements around the site and to gather demographic information about our user\r\nbase as a whole. The information collected is used solely for internal review\r\nand not shared.</p>\r\n\r\n<p class=\"MsoSubtitle\" style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:\r\nl0 level1 lfo1\"><b><span style=\"font-size:14.0pt;\r\nline-height:107%;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\"><span style=\"mso-list:Ignore\">4.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;\r\n</span></span></span></b><b><span style=\"font-size:14.0pt;line-height:\r\n107%\">SECURITY PRECAUTIONS</span></b></p>\r\n\r\n<p class=\"MsoSubtitle\">Our Website has stringent security measures in place to\r\nprotect the loss, misuse, and alteration of the information under our control.\r\nWhenever you change or access your account information, we offer the use of a\r\nsecure server. Once your information is in our possession, we adhere to strict\r\nsecurity guidelines, protecting it against unauthorized access.</p>\r\n\r\n<p class=\"MsoSubtitle\" style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:\r\nl0 level1 lfo1\"><b><span style=\"font-size:14.0pt;\r\nline-height:107%;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\"><span style=\"mso-list:Ignore\">5.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;\r\n</span></span></span></b><b><span style=\"font-size:14.0pt;line-height:\r\n107%\">UPDATES</span></b></p>\r\n\r\n<p class=\"MsoSubtitle\">MANGALUTSAV.COM reserves the right to make changes in this\r\npolicy and will be made available so that you are always aware of what\r\ninformation we collect, how we use it, and under what circumstances we disclose\r\nit. Of course, our use of any information we gather will always be consistent\r\nwith the policy under which the information was collected, regardless of what\r\nthe new policy may be. </p>\r\n\r\n<p class=\"MsoSubtitle\" style=\"margin-left:36.0pt;text-indent:-18.0pt;mso-list:\r\nl0 level1 lfo1\"><b><span style=\"font-size:14.0pt;\r\nline-height:107%;mso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;\r\nmso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\"><span style=\"mso-list:Ignore\">6.<span style=\"font:7.0pt \" times=\"\" new=\"\" roman\"\"=\"\">&nbsp;&nbsp;\r\n</span></span></span></b><b><span style=\"font-size:14.0pt;line-height:\r\n107%\">AGREEING TO TERMS</span></b></p>\r\n\r\n<p class=\"MsoSubtitle\">By using the MANGALUTSAV.COM Website and/ or by providing\r\nyour information, you consent to the collection and use of the information you\r\ndisclose on the Website in accordance with this Privacy Policy, including but\r\nnot limited to Your consent for sharing your information as per this privacy\r\npolicy.</p>\r\n\r\n<p class=\"MsoSubtitle\">&nbsp;</p>\r\n\r\n<p class=\"MsoSubtitle\">&nbsp;</p>\r\n\r\n<p><!--[if gte mso 9]><xml>\r\n <o:OfficeDocumentSettings>\r\n  <o:AllowPNG></o:AllowPNG>\r\n </o:OfficeDocumentSettings>\r\n</xml><![endif]--><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves></w:TrackMoves>\r\n  <w:TrackFormatting></w:TrackFormatting>\r\n  <w:PunctuationKerning></w:PunctuationKerning>\r\n  <w:ValidateAgainstSchemas></w:ValidateAgainstSchemas>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixedContent>\r\n  <w:AlwaysShowPlaceholderText>false</w:AlwaysShowPlaceholderText>\r\n  <w:DoNotPromoteQF></w:DoNotPromoteQF>\r\n  <w:LidThemeOther>EN-IN</w:LidThemeOther>\r\n  <w:LidThemeAsian>X-NONE</w:LidThemeAsian>\r\n  <w:LidThemeComplexScript>HI</w:LidThemeComplexScript>\r\n  <w:Compatibility>\r\n   <w:BreakWrappedTables></w:BreakWrappedTables>\r\n   <w:SnapToGridInCell></w:SnapToGridInCell>\r\n   <w:WrapTextWithPunct></w:WrapTextWithPunct>\r\n   <w:UseAsianBreakRules></w:UseAsianBreakRules>\r\n   <w:DontGrowAutofit></w:DontGrowAutofit>\r\n   <w:SplitPgBrea