(7, 3, 'Return Policy Page', '<p>\r\n\r\n</p><p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"mso-bidi-font-size:11.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">Return, Replacement, Refund and Cancellation\r\nPolicy </span></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">Cancellation is possible only before\r\ndispatch:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal;background:white\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\">You can raise cancellation requests any time <b>before we dispatch your ordered\r\nitem</b>. Unfortunately, we <b>cannot cancel orders</b> once the shipment is dispatched.\r\n</span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal;background:white\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\">Generally, we use to dispatch the ordered products, approximately, between\r\n12 business hours to 36 business hours of placing the order. </span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal;background:white\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\">So, you can surely cancel the order within 12 hours of placing the order,\r\njust by texting us/ writing to us with your registered email id / mobile number.\r\nYou may also contact us to cancel the orders within 48 hours of placing the\r\norder, as there may be some chances to get it cancelled if dispatch is not done\r\nat that time.</span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal;background:white\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal;background:white\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\">If delivery is not accepted by you, the mangalutsav.com (M/s SHUBHKAMNA\r\nFABRICS) reserves the right to recover reasonable compensation for charges\r\nincurred in shipping, handling, packing, processing your order and any other\r\nservices provided to you - the remaining amount after deductions shall be\r\nreturned to you.</span><span style=\"font-size:10.0pt;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal;background:white\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">We don’t accept Return/ Replacement/ Refund\r\nrequest if:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">1.</span></b><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\"> If there is slight difference in the design/\r\ncolor of the product which customer receives and sees at the website. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">2.</span></b><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\"> If made-ups is slightly misfit with\r\nthe customer’s actual fittings.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-justify:inter-ideograph;line-height:normal;background:\r\nwhite\"><b><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;;color:black;mso-color-alt:windowtext\" lang=\"EN-US\">3.</span></b><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Book Antiqua&quot;;color:black;mso-color-alt:windowtext\" lang=\"EN-US\"> </span><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\">In-case of minor dimension changes. As Dimension of the product can not\r\nbe exactly same which is mentioned in our product description.</span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-justify:inter-ideograph;line-height:normal;background:\r\nwhite\"><b><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;\r\nmso-fareast-language:EN-IN\" lang=\"EN-US\">4.</span></b><span style=\"font-size:\r\n10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-alt:windowtext;mso-fareast-language:EN-IN\" lang=\"EN-US\"> In-case of\r\nminor variation from the Product Image.</span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\"> It is almost impossible to match the Product image with original\r\nproduct as the device used to view the product image cannot provide accurate\r\ncolors. </span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-justify:inter-ideograph;line-height:normal;background:\r\nwhite\"><b><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;\r\nmso-fareast-language:EN-IN\" lang=\"EN-US\">5</span></b><span style=\"font-size:10.5pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-alt:windowtext;mso-fareast-language:EN-IN\" lang=\"EN-US\">. Incorrect or\r\nobsolete delivery address provided by the customer.</span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-justify:inter-ideograph;line-height:normal;background:\r\nwhite\"><b><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;\r\nmso-fareast-language:EN-IN\" lang=\"EN-US\">6. </span></b><span style=\"font-size:\r\n10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-alt:windowtext;mso-fareast-language:EN-IN\" lang=\"EN-US\">If the\r\nshipment is refused/denied by the recipient</span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"mso-margin-top-alt:auto;mso-margin-bottom-alt:auto;\r\ntext-align:justify;text-justify:inter-ideograph;line-height:normal;background:\r\nwhite\"><b><span style=\"font-size:10.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;\r\nmso-fareast-language:EN-IN\" lang=\"EN-US\">7.</span></b><span style=\"font-size:\r\n10.5pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-alt:windowtext;mso-fareast-language:EN-IN\" lang=\"EN-US\"> If the\r\nproducts returned are in a used condition</span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\">.</span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"mso-bidi-font-size:\r\n11.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">Only\r\nIn the following conditions return/replacement/refund is possible:</span></b><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\"></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:14.2pt;text-indent:-14.2pt;line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:18.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">•<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">If any <b>Wrong\r\nItem</b> has been delivered to you. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:14.2pt;text-indent:-14.2pt;line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:18.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">•<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">If the <b>Shipment\r\nis Lost</b> during transit.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:14.2pt;text-indent:-14.2pt;line-height:normal;mso-list:l0 level1 lfo1\"><span style=\"font-size:18.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\" lang=\"EN-US\"><span style=\"mso-list:Ignore\">•<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;\r\n</span></span></span><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">If you\r\nhave received a <b>Damaged/ Genuinely </b></span><span class=\"c0\"><b><span style=\"mso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\ncolor:black\" lang=\"EN-US\">Defective/ Broken</span></b></span><b><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Book Antiqua&quot;\" lang=\"EN-US\"> item</span></b><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:36.0pt;line-height:normal\"><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">What to do if the item received is Wrong\r\nor Damaged/ Broken:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">At mangalutsav.com we work very hard to\r\ndeliver the best products and shopping experience to you. However, sometimes\r\nbecause of the scale of operation a few exceptional cases do happen. We will\r\ntry our best to replace the wrong/damaged product to your satisfaction and if that\r\nis not possible because of some operational constraint then we will provide\r\nfull refund as per the requirement. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN;\r\nmso-bidi-font-weight:bold\" lang=\"EN-US\">If you receive fully damaged item, please, </span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:EN-IN\" lang=\"EN-US\">inform us within 48 hours of receiving the product.</span></b><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN;\r\nmso-bidi-font-weight:bold\" lang=\"EN-US\"> Please provide us the necessary data like order\r\ndate, order number and other details along with images of that damaged item.</span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:EN-IN\" lang=\"EN-US\"> </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;\r\nline-height:115%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-fareast-language:EN-IN\" lang=\"EN-US\">Contact Us</span></b><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">: In all such circumstances, for\r\ncancelling the product and before using the product, please get in touch with\r\nour Customer Service Team at </span><span lang=\"EN-US\"><a href=\"mailto:info@mangalutsav.com\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\">info@mangalutsav.com</span></b></a></span><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\"> within 48 hours of receiving the <b style=\"mso-bidi-font-weight:normal\">Wrong or Damaged</b><span style=\"mso-spacerun:yes\">&nbsp; </span>product.</span><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:10.0pt;line-height:115%;font-family:\r\n&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\"></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-justify:\r\ninter-ideograph;line-height:normal;background:white\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;mso-fareast-language:\r\nEN-IN;mso-bidi-font-weight:bold\" lang=\"EN-US\">You can contact us on </span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-alt:windowtext;mso-fareast-language:EN-IN\" lang=\"EN-US\">Whatsapp +91- 8765504000\r\n(12:30 PM – 07:30 PM IST</span></b><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-alt:windowtext;mso-fareast-language:EN-IN;mso-bidi-font-weight:\r\nbold\" lang=\"EN-US\">) </span><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:black;mso-color-alt:windowtext;mso-fareast-language:\r\nEN-IN\" lang=\"EN-US\">(Monday to Saturday</span></b><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\ncolor:black;mso-color-alt:windowtext;mso-fareast-language:EN-IN;mso-bidi-font-weight:\r\nbold\" lang=\"EN-US\">) </span><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-fareast-language:EN-IN;\r\nmso-bidi-font-weight:bold\" lang=\"EN-US\"></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;text-align:justify;text-justify:inter-ideograph;line-height:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">If you have received your order with\r\nthe outer packaging tampered/meddled, then please capture a snap of the same\r\nand share with us. To make things fair for all of us and provide you with the\r\nbenefits of the Return/Refund Policy, we adhere to below mention points:</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;text-align:justify;text-justify:inter-ideograph;line-height:\r\nnormal\"><b><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">Terms and Conditions for Return/ Refund/\r\nReplacement:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;text-align:justify;text-justify:inter-ideograph;line-height:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">1. <b>All complaints to be made within\r\n48 hours of receipt of Wrong/Damaged/Broken goods.</b></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;line-height:normal\"><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">2.. All\r\nitems to be returned must be <b style=\"mso-bidi-font-weight:normal\">unused and\r\nin their original condition</b>. The original tags, packaging should be intact\r\n(so that if possible, they are re-sellable after minor fixes)</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;line-height:normal\"><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">3. We\r\nwould not be able to accept a product if it shows sign of being broken or\r\ntampered.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;text-align:justify;text-justify:inter-ideograph;line-height:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">4. We expect that while returning the\r\nproduct you will pack the product very safely and securely. We won\'t be able to\r\nentertain any damage/lost in Transit (For example:- If a complaint was raised\r\nfor Wrong Product Delivery and the sent item got damaged in the transit then we\r\nwill not be responsible for the damage and eventually may not be in a position\r\nof replacement for the original one as well).</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;text-align:justify;text-justify:inter-ideograph;line-height:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">5.<span style=\"mso-spacerun:yes\">&nbsp;\r\n</span>Always return your items using registered courier who provides proof of\r\ndelivery.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;text-align:justify;text-justify:inter-ideograph;line-height:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">6. Please ship the product (which is to\r\nbe returned) within 3 working days of confirmation from our end. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;text-align:justify;text-justify:inter-ideograph;line-height:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">7. Please ensure to include a copy of\r\nthe invoice you received.</span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\"><span style=\"mso-spacerun:yes\">&nbsp;</span>8. On receipt of any Wrong/ Damaged/ Broken\r\nitem, we will dispatch a replacement (probably same item if available) item after\r\nreceiving the return shipment from customer.</span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">9.<span style=\"mso-spacerun:yes\">&nbsp; </span>If the original ordered item is not available\r\nthen we will request you to choose an alternate item and will dispatch it to\r\nyou. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;text-align:justify;text-justify:inter-ideograph;line-height:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">10. If you do not want any alternate\r\n(if same item is not available) item then we will refund your cost of goods. </span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;line-height:normal\"><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">1<b>1. </b></span><b><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\" lang=\"EN-US\">You have to return goods to the following Address</span></b><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\" lang=\"EN-US\"><br style=\"mso-special-character:line-break\">\r\n<br style=\"mso-special-character:line-break\">\r\n</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;line-height:normal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\" lang=\"EN-US\">Address:<span style=\"mso-spacerun:yes\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"mso-tab-count:1\">&nbsp; </span>M/s Shubhkamna Fabrics</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:0cm;line-height:normal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\" lang=\"EN-US\"><span style=\"mso-tab-count:2\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span>Ck\r\n20/10, Ayushman Katra, Ground Floor, </span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:36.0pt;text-indent:36.0pt;line-height:normal\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">Thatheri Bazaar, Chowk, Varanasi –\r\n221001.</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:5.0pt;margin-right:0cm;margin-bottom:5.0pt;\r\nmargin-left:36.0pt;text-indent:36.0pt;line-height:normal\"><b style=\"mso-bidi-font-weight:\r\nnormal\"><span style=\"font-size:10.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\" lang=\"EN-US\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\"><br></span></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">&nbsp;</span></b></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">What to do if Shipment (item) is lost\r\nduring transit:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">If the shipment is lost in transit, it\r\ntakes 15 days to verify the details and provide for replacement/refund, from\r\ndate of dispatch of the item. As we need confirmation from delivery agent with\r\nregard to loss of consignment and after confirmation from delivery agent only\r\nwe will dispatch you the same/alternate item as per availability and your\r\nconsent.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">WE ONLY REFUND WHEN ORIGINAL ITEM IS\r\nNOT AVAILABLE FOR REPLACEMENT AND CUSTOMER IS NOT WILLING TO TAKE ANY ALTERNATE\r\nITEM.</span></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">Partial-Refunds:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">In case of multiple goods being\r\nordered, if the delivery is not possible for some of the items, customers will\r\nbe requested to select alternate items or if no alternate selection is desired\r\nby customer then the amount will be promptly refunded against the non-delivered\r\ngoods along with their shipping charges.</span></p>\r\n\r\n<p class=\"MsoNormal\"><b style=\"mso-bidi-font-weight:normal\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">Credit Processing:</span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"text-align:justify;text-justify:inter-ideograph\"><span style=\"font-size:10.0pt;line-height:115%;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">All credits towards refund takes 3 - 5\r\nbusiness days to reflect in the respective credit or debit card/ bank /Wallet\r\naccount. Any refund will take place only after receiving the intact product\r\nfrom customer’s end.</span></p>\r\n\r\n<p class=\"MsoNormal\"><span style=\"font-size:10.0pt;line-height:115%;\r\nfont-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:&quot;Book Antiqua&quot;\" lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<p><!--[if gte mso 9]><xml>\r\n <w:WordDocument>\r\n  <w:View>Normal</w:View>\r\n  <w:Zoom>0</w:Zoom>\r\n  <w:TrackMoves/>\r\n  <w:TrackFormatting/>\r\n  <w:PunctuationKerning/>\r\n  <w:ValidateAgainstSchemas/>\r\n  <w:SaveIfXMLInvalid>false</w:SaveIfXMLInvalid>\r\n  <w:IgnoreMixedContent>false</w:IgnoreMixed